import React, { useRef, useState, useEffect } from 'react';
import { Canvas, useLoader, useFrame } from '@react-three/fiber';
import { OrbitControls, Environment, Center } from '@react-three/drei';
import { STLLoader } from 'three/examples/jsm/loaders/STLLoader';
import * as THREE from 'three';
import './STLViewer.css';

function STLModel({ url, isSelected }) {
  const meshRef = useRef();
  const [geometry, setGeometry] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    setError(null);

    const loader = new STLLoader();
    loader.load(
      url,
      (geometry) => {
        // Compute normals for proper lighting
        geometry.computeVertexNormals();
        setGeometry(geometry);
        setLoading(false);
      },
      (progress) => {
        // Progress callback
        console.log('Loading progress:', (progress.loaded / progress.total) * 100 + '%');
      },
      (error) => {
        console.error('Error loading STL:', error);
        setError('Failed to load STL file');
        setLoading(false);
      }
    );
  }, [url]);

  useFrame((state) => {
    if (meshRef.current && isSelected) {
      // Gentle rotation when selected
      meshRef.current.rotation.y += 0.005;
    }
  });

  if (loading) {
    return (
      <Center>
        <mesh>
          <boxGeometry args={[1, 1, 1]} />
          <meshStandardMaterial color="#cccccc" wireframe />
        </mesh>
      </Center>
    );
  }

  if (error) {
    return (
      <Center>
        <mesh>
          <boxGeometry args={[2, 0.5, 0.1]} />
          <meshStandardMaterial color="#ff6b6b" />
        </mesh>
      </Center>
    );
  }

  if (!geometry) return null;

  return (
    <Center>
      <mesh ref={meshRef}>
        <primitive object={geometry} />
        <meshStandardMaterial 
          color={isSelected ? "#4ecdc4" : "#95a5a6"} 
          metalness={0.3}
          roughness={0.4}
        />
      </mesh>
    </Center>
  );
}

function STLViewer({ stlFile, isVisible }) {
  const [isLoading, setIsLoading] = useState(false);

  if (!isVisible || !stlFile) {
    return (
      <div className="stl-viewer">
        <h3>3D Viewer</h3>
        <div className="viewer-placeholder">
          <p>üîß 3D STL Viewer</p>
          <p>Select an STL file to view it in 3D</p>
        </div>
      </div>
    );
  }

  const stlUrl = `/stl/${stlFile.name}`;

  return (
    <div className="stl-viewer">
      <h3>3D Viewer - {stlFile.name}</h3>
      <div className="viewer-container">
        <Canvas
          camera={{ position: [0, 0, 5], fov: 50 }}
          style={{ width: '100%', height: '400px' }}
        >
          <ambientLight intensity={0.5} />
          <directionalLight position={[10, 10, 5]} intensity={1} />
          <pointLight position={[-10, -10, -5]} intensity={0.5} />

          <STLModel url={stlUrl} isSelected={true} />

          <OrbitControls 
            enablePan={true}
            enableZoom={true}
            enableRotate={true}
            autoRotate={false}
          />

          <Environment preset="studio" />
        </Canvas>
      </div>
      <div className="viewer-info">
        <p><strong>File:</strong> {stlFile.name}</p>
        <p><strong>Description:</strong> {stlFile.description}</p>
        <div className="controls-info">
          <small>
            üñ±Ô∏è Left click + drag to rotate ‚Ä¢ Scroll to zoom ‚Ä¢ Right click + drag to pan
          </small>
        </div>
      </div>
    </div>
  );
}

export default STLViewer;
